import React from "react";
import "./Modal.css";


function Modal({ setOpenModal }) {
  return (
    <div className="modalBackground">
      <div className="modalContainer">
        <div className="titleCloseBtn">
          <button
            onClick={() => {
              setOpenModal(false);
            }}
          >
            X
          </button>
        </div>
        <div className="title">
          <h1>Adicionar Novo</h1>
        </div>

        <form action="elements" method="get">
          Name: <input type="text" name="nome" /><br />
          Ano: <input type="number" name="ano" /><br />
          Velocidade Máx: <input type="number" name="v máx" /><br />
          
        </form>

        <div className="footer">
          <button
            onClick={() => {
              setOpenModal(false);
            }}
            id="cancelBtn"
          >
            Cancelar
          </button>
          <input type="submit" value="Enviar" />
        </div>
      </div>
    </div>
  );
}

export default Modal;
